import React from 'react';

const KarvaanLogo = ({ className = "h-8 w-auto" }) => {
  return (
    <div className={`flex items-center ${className}`}>
      <svg 
        viewBox="0 0 40 40" 
        className="h-full w-auto mr-2"
        fill="currentColor"
      >
        <circle cx="20" cy="20" r="18" className="opacity-20" />
        <path d="M12 16l8 8 8-8" stroke="currentColor" strokeWidth="2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        <circle cx="20" cy="20" r="3" />
      </svg>
      <span className="font-bold text-xl font-poppins">Karvaan</span>
    </div>
  );
};

export default KarvaanLogo;
